import React from 'react'
import {Nav}  from 'react-bootstrap';
import styled from 'styled-components';
import 'bootstrap/dist/css/bootstrap.css';


const Link = styled(Nav.Link)`
    color: white;
    &:hover{
        color: #EAEFD3;
    }
`;

const navLink = () => {
    return (
        <div>
            <Link/>
        </div>
    )
}

export default navLink
